import React, { useState } from 'react'
import './post.css';
import ThumbUpAltIcon from '@material-ui/icons/ThumbUpAlt';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import FavoriteIcon from '@material-ui/icons/Favorite';

function Post() {
    let x = 0;
    const adding = y => y ++;
    const [ like, setLike ] = useState(0);
    const [ value, setValue ] = useState(false);
    return (
        <div className="statusContainer">
            <div className="postWrapper">
                <div className="postTop">
                    <div className="postTop-left">
                        <img src="/assets/images/profile1.jpg" alt="" className="postTopImg" />
                        <p className="heading">Safeer Ahmed</p>
                        <p className="timestamp">5 mins ago</p>
                    </div>
                    <MoreVertIcon className="dotIcon" />
                </div>
                <div className="caption">
                    <p className="captionText">Don't see my dp if you can't control your bp</p>
                </div>
                <div className="postImageContainer">
                    <img src="/assets/images/post1.jpg" alt="" className="postImage" />
                </div>
                <div className="postBottom">
                    <div className="postBottom-left">
                        <div className="likeIconBG">
                            <ThumbUpAltIcon onClick= { ()=> {
                                adding(x)
                                setLike(x);
                                
                                // setValue(true); 
                            } } className="likeIcon" />
                        </div>                       
                        <div className="heartIconBG">
                            <FavoriteIcon className="heartIcon" />
                        </div>
                        <p className="likeDesc"><span className="likeNum"> {like} </span>people like it</p>
                    </div>
                    <p className="comments"><span className="commentNum"> 12 </span>comments</p>
                </div>
            </div>
        </div>
    )
}

export default Post
